import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { Card, Badge, Button, Spinner, Alert } from 'react-bootstrap';
import api from '../../services/api';

const ReportList = ({ userId, filter = 'all' }) => {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchReports = async () => {
      try {
        let url = '/reports';
        if (userId) {
          url += `?userId=${userId}`;
        }
        if (filter !== 'all') {
          url += userId ? `&status=${filter}` : `?status=${filter}`;
        }

        const response = await api.get(url);
        setReports(response.data);
      } catch (error) {
        console.error('Failed to fetch reports:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchReports();
  }, [userId, filter]);

  const getStatusVariant = (status) => {
    switch (status) {
      case 'pending':
        return 'warning';
      case 'in-progress':
        return 'info';
      case 'resolved':
        return 'success';
      default:
        return 'secondary';
    }
  };

  const formatDate = (dateString) => {
    const options = { year: 'numeric', month: 'short', day: 'numeric' };
    return new Date(dateString).toLocaleDateString(undefined, options);
  };

  if (loading) {
    return (
      <div className="d-flex justify-content-center p-4">
        <Spinner animation="border" role="status">
          <span className="visually-hidden">Loading...</span>
        </Spinner>
      </div>
    );
  }

  if (reports.length === 0) {
    return (
      <Alert variant="info" className="text-center">
        <i className="fas fa-clipboard-list fa-2x mb-3 d-block" style={{ color: '#80ACC2' }}></i>
        <h4>No reports found</h4>
        <p>
          {filter === 'all' 
            ? "You haven't submitted any reports yet. Start by reporting a new issue." 
            : `You don't have any ${filter} reports.`
          }
        </p>
        <Button 
          variant="primary" 
          className="mt-2"
          style={{ backgroundColor: '#80ACC2', border: 'none' }}
          as={Link}
          to="/report-form"
        >
          <i className="fas fa-plus me-2"></i>
          Report New Issue
        </Button>
      </Alert>
    );
  }

  return (
    <div>
      {reports.map(report => (
        <Card key={report._id} className="mb-3 border-0 shadow-sm">
          <Card.Body className="p-4">
            <div className="d-flex justify-content-between align-items-start mb-2">
              <h5 className="fw-bold mb-0" style={{ color: '#4a6b7a' }}>{report.title}</h5>
              <Badge bg={getStatusVariant(report.status)} className="text-capitalize">
                {report.status.replace('-', ' ')}
              </Badge>
            </div>
            <p className="text-muted mb-3">
              <small>
                <i className="far fa-calendar me-1"></i>
                {formatDate(report.createdAt)}
              </small>
            </p>
            <p className="mb-3">
              {report.description.length > 150 
                ? `${report.description.substring(0, 150)}...` 
                : report.description
              }
            </p>
            <div className="d-flex justify-content-between align-items-center">
              <div className="d-flex gap-3">
                <span className="text-muted">
                  <i className="fas fa-map-marker-alt me-1"></i>
                  {report.location}
                </span>
                <span className="text-muted">
                  <i className="fas fa-tag me-1"></i>
                  {report.category}
                </span>
              </div>
              <Button 
                variant="outline-primary" 
                size="sm"
                style={{ color: '#80ACC2', borderColor: '#80ACC2' }}
                as={Link}
                to={`/reports/${report._id}`}
              >
                View Details
                <i className="fas fa-arrow-right ms-1"></i>
              </Button>
            </div>
          </Card.Body>
        </Card>
      ))}
    </div>
  );
};

export default ReportList;
